import styled from "styled-components";

const NewFormArea = styled.div`
    margin: 0.5rem 0;

    &label {
        font-weight: bold;
        margin-top: 1.5rem;
    }


`

const NewForm = () => {
 return (
    <form>
        <NewFormArea>
            <label >Username</label>
            <input type="text" />
            <label >Age (Years)</label>
            <input type="text" />
        </NewFormArea>

    </form>
 )
}

export default NewForm;
